import React, { Component } from 'react';
import { connect } from 'react-redux';

import NotifyList from '../components/UI/NotifyList/NotifyList';

class NotifyListContainer extends Component {
  render() {
    return (
      <NotifyList notifyList={this.props.NotifyList}/>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    notify: state.notifyList
  };
}


export default connect(mapStateToProps)(NotifyListContainer);
